def recipe(item_url):
    recipe_dict = dict()
    session = requests.Session()
    retry = Retry(connect=3, backoff_factor=0.5)
    adapter = HTTPAdapter(max_retries=retry)
    session.mount('http://', adapter)
    session.mount('https://', adapter)

    session.get(url)
    item_source = session.get(url+item_url)

    recipe_soup = BeautifulSoup(item_source.content, 'html.parser')
    tmp_dict = dict()
    title = recipe_soup.find('h1').text

    tmp_dict['summary'] = recipe_soup.find('span',{'class':'summary'}).text

    ingredient_list = list()

    for i in recipe_soup.findAll('li',{'class':'ingredient'}):
        ingredient_list.append(i.find('a').text)

    tmp_dict['ingredient'] = ingredient_list

    directions_list = list()

    for j in recipe_soup.findAll('li', {'class':'instruction'}):
        directions_list.append(j.text)
    
    tmp_dict['directions'] = directions_list

    try:
        tmp_dict['yield'] = recipe_soup.find('div',{'class':'yield'}).text
    except:
        tmp_dict['yield'] = 'None'

    try:
        tmp_dict['prep_Time'] = recipe_soup.find('div',{'class':'prepTime'}).text
    except:
        tmp_dict['prep_Time'] = 'None'

    try:
        tmp_dict['cook_Time'] = recipe_soup.find('div',{'class':'cookTime'}).text
    except:
        tmp_dict['cook_Time'] = 'None'

    try:
        meal_type_list = list()
        for i in recipe_soup.findAll('div',{'class':'tag'}):
            meal_type_list.append(i.text)
        tmp_dict['meal_type'] = meal_type_list    
    except:
        tmp_dict['meal_type'] = 'None'

    recipe_dict[title] = tmp_dict
    print('Details for recipe fetched and returned succefully: ', title)
    return recipe_dict

